    <div class="intro_text f12 pd15 lh18">
              “农夫乐园是一个以文化创意为魂，以绿色环保、亲子动漫为主题，颠覆传统农业旅游形态的国家AAA级生态亲子主题旅游景区。2010年至2013年连续四届杭州西博会项目之一；2011年-2015年连续5届国际动漫节分会场，被评为中国国际动漫节最佳分会场；连续举办两届“冰雕节”；2011年开始至2015年秋季每年举办“乡村狂欢节”。 2016年农夫乐园举办杭州首届国际梦幻灯光节！        2016年10月份秋季农夫乐园将推出第五届乡村“萌宠总动员”，有可爱的萌宠互动，有教育意义的蝴蝶科普，有欢乐的家庭亲子表演互动活动（抗日向英雄、沙滩寻宝、水枪大战、撕名牌、小香猪赛跑、农夫运动会等活动），更有数不尽的游乐设施骑马、卡丁车、划船等乐不胜收。
  
        
